const theme = {
  black: "#333333",
  blue: "#1873e7",
  lightGray: "#e5e5e5",
  gray: "#7a7a7a",
  transparentBlack: "rgba(0, 0, 0, 0.25)",
  white: "#ffffff"
};

export default theme;
